A number of GIS layers were provided by Council to assist with the study. This included:
•   Aerial Photography – provides 2014 ortho-rectified aerial imagery at a 0.5 metre pixel size;
•   Cadastre – provides property boundary polygons;
•   Stormwater Pipes – Provides alignments, lengths and diameters of stormwater pipes;
•   Stormwater Pits – Provides locations and types of stormwater pits/inlets;
•   Road Centrelines – Provides locations and names of roadways within the study area
Each allotment within the catchment was assigned an ERP classification for the 20% AEP, 5% AEP, 1% AEP and PMF. This was completed using the TUFLOW model results, digital elevation model and a road network GIS layer.

The State’s taxation revenue is forecast by a process that involves:  

application of the Department of Treasury and Finance’s economic forecasts, where there is a relationship between taxation revenue and economic variables; and
use of forward indicators, unpublished revenue data and qualitative information from liaison with relevant stakeholders. 

This enables an assessment of economic and other factors influencing the tax
bases from which taxes are sourced e.g. for payroll tax, an assessment of the
outlook for employment.  
Where necessary, adjustment factors are used to account for other trends or
events not captured by the model, such as impact of economic shocks or policy
stimulus.  
The download contains the eight taxation data series:

total taxation revenue;
payroll tax;
land tax;
land transfer duty;
gambling taxes;
insurance taxes;
motor vehicle taxes; and
other taxes.

Overall the key objectives of this program are to: 
1. Identify and map the principal foraging locations for shearwaters and boobies breeding at the most important colonies of the GBR, both within and between breeding seasons, using a combination of different Geolocation, GPS and Satellite PTT data loggers; 
2. Obtain detailed information on the biophysical oceanographic characteristics of these foraging habitats in both the GBR and Coral Sea regions using a range of biophysical parameters derived from satellite and in situ data; 
3. Quantify how prey availability at these sites varies with climate driven changes in biophysical oceanography; 
4. quantifying the level of prey availability and associated oceanographic conditions required to maintain viable reproduction at significant breeding colonies and 5) establish potential linkages and interactions between these areas/processes and other anthropogenic activities.
